import './App.css';
import { getWeatherApi } from './api/weather.js'

function App() {

  getWeatherApi(weather)
    .then(data => {
      console.log(data.resolvedAddress)
      return data
    })

  return (
    <div className="App">
      <header className="App-header">
        <h1>Hello world</h1>
        <p>{weather}</p>
      </header>
    </div>
  );
}

export default App;
